// src/pages/CalendarPage.js
import React, { useState } from 'react';
import { Calendar, momentLocalizer } from 'react-big-calendar';
import moment from 'moment';
import 'react-big-calendar/lib/css/react-big-calendar.css';

const localizer = momentLocalizer(moment);

const CalendarPage = () => {
  const [events, setEvents] = useState([
    {
      title: 'Clase de Ética Profesional',
      start: new Date(2024, 8, 23, 21, 0),  // 23 de Septiembre 2024, 9:00 pm
      end: new Date(2024, 8, 23, 22, 0),    // 23 de Septiembre 2024, 10:00 pm
      allDay: false,
    },
    {
      title: 'Desarrollo de Software II',
      start: new Date(2024, 8, 23, 20, 15), // 23 de Septiembre 2024, 8:15 pm
      end: new Date(2024, 8, 23, 22, 30),   // 23 de Septiembre 2024, 10:30 pm
      allDay: false,
    },
  ]);

  return (
    <div style={{ height: '500px' }}>
      <Calendar
        localizer={localizer}
        events={events}
        startAccessor="start"
        endAccessor="end"
        style={{ height: 500, margin: '50px' }}
      />
    </div>
  );
};

export default CalendarPage;
